import { FETCH_IMAGES, UPLOAD_CSV } from '../actions/types';

const initialState = {
	images: [],
  batch_id: null,
  page: null
}

export default function(state = initialState, action) {
  switch(action.type) {
    case FETCH_IMAGES:
      return {
        ...state,
        items: action.payload
      }
    case UPLOAD_CSV:
      return {
        ...state,
        items: action.payload
      }
    default:
      return state;
  }
}
